webpackJsonp([51523148733183],{378:function(e,p){e.exports={pathContext:{posts:[{html:'<h3>Installing Jhipster</h3>\n<pre><code>npm install -g generator-jhipster\n</code></pre>\n<pre><code>jhipster --version\n</code></pre>\n<h3>Generating an app</h3>\n<pre><code>mkdir myPOC &#x26;&#x26; cd myPOC\n</code></pre>\n<pre><code>jhipster\n</code></pre>\n<pre><code>code .\n</code></pre>\n<pre><code>npm install\n</code></pre>\n<pre><code>mvn spring-boot:run\n</code></pre>\n<pre><code>npm start\n</code></pre>\n<pre><code>gedit src/main/resources/entities.jh\n</code></pre>\n<pre><code>jhipster import-jdl src/main/resources/entities.jh\n</code></pre>\n<h3>Leveraging available Jhipster options</h3>\n<p>A number of possible options in using Jhipster are described in the README.md file of the project folder.</p>\n<p>To run the JHipster Registry from the Docker image available in the application src/main/docker directory just run: </p>\n<pre><code>docker-compose -f src/main/docker/jhipster-registry.yml up\n</code></pre>\n<h3>Jhipster Marketplace modules of interest</h3>\n<p>Kafka</p>\n<p>Stripe Payment </p>\n<p>Paypal</p>\n<p>Blockchain</p>\n<h3>Links</h3>\n<p><a href="https://www.jhipster.tech/">JHipster Homepage</a></p>\n<p><a href="https://start.jhipster.tech/jdl-studio/">JDL Studio</a></p>\n<p><a href="https://github.com/jhipster">github page</a></p>',id:"/home/nperon/Documents/workshop/src/pages/2020-07-05-jhipster/index.md absPath of file >>> MarkdownRemark",frontmatter:{date:"2020-07-05T18:51:12.235Z",path:"/jhipster",title:"Generate and deploy a Java app on the cloud with Jhipster",excerpt:"",tags:["jhipster","aws"]}}],tagName:"jhipster"}}}});
